import Register from "./Register";
import React, { useState } from "react";
import {setCount,count} from "reactstrap";
const Navbar=()=>{


  //function Form() {
    

    return(
        <div>

<nav class="navbar navbar-expand-lg navbar-dark bg-dark">
  <div class="container-fluid">
    <a class="navbar-brand" href="/home">Course App</a>
    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarSupportedContent">
      <ul class="navbar-nav mx-auto mb-2 mb-lg-0">

        <li class="nav-item">
          <a class="nav-link active" aria-current="page" href="/home">Home</a>
        </li>

        <li class="nav-item">
          <a class="nav-link" aria-current="page" href="/courses">Courses</a>
        </li>

        <li class="nav-item">
          <a class="nav-link" href="#"></a>
        </li>
        <li class="nav-item">
          <a class="nav-link" aria-current="page" href="/about">About</a>
        </li>
        <li class="nav-item">
          <a class="nav-link disabled" href="#">Contact</a>
        </li>
        
        {/*<div class="d-grid gap-4 d-md-flex justify-content-md-end">
        <button class="btn btn-warning me-md-10" type="button" 
        >Register</button>
        <button class="btn btn-warning" type="button">Login</button>
        <button class="btn btn-primary" type="button">Cart</button>
    </div>*/}



const [count, setCount] = useState(0);

return (

  <>

    <p>{count}</p>

    <button onClick={() => setCount(count + 1)}>Register</button>

    <button onClick={() => setCount(count - 1)}>Decrement Button</button>

  </>

);


      </ul>
      
    </div>
  </div>
</nav>


        </div>
    );
}
export default Navbar;
